import React from 'react';
import './Boards.css';
import {Card} from 'react-bootstrap';
import note from './note.jpg';

const card = (props) => 
{
    return(
        <Card className="boards">
            <Card.Img src={note}
            width ="150em"
            height ="150em"/>
            <Card.ImgOverlay>
                <Card.text className="card-title">{props.children}</Card.text>
            </Card.ImgOverlay>
        </Card>
    )
}

export default card
